export default class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route exact path="/" component={DisplayAllMovies} />
          <Route exact path="/AddMovie" component={AddMovie} />
        </Switch>
      </BrowserRouter>
    );
  }
}
